import React from 'react';
import {ThemeProvider, theme, ColorModeProvider, CSSReset} from '@chakra-ui/react';
import ThemeToggler from './components/ThemeToggler/ThemeToggler';


export function App() {
  return (
    <ThemeProvider theme={theme}>
      <ColorModeProvider>
      <CSSReset />
      <ThemeToggler />
      </ColorModeProvider>
    </ThemeProvider>
  );
}

export default App;
